import React from 'react';


let element = <h1 className='title' style={{ color: 'red' }}>
  <span>hello</span>
  world
</h1>


let element1 = React.createElement('h1', {
  className: 'title',
  style: {
    color: 'red'
  }
}, React.createElement('span', null, 'hello'), 'world')

console.log(element1)




function App() {
  return (
    <div className="App">
      App
    </div>
  );
}

export default App;
